const Bio = () => {
  return (
    <div className="bio">
      <h1>About Yusuf</h1>
      <p>
        Hi, I'm a software developer. I'm really passionate about bringing my
        ideas to life through code and I truly view coding as my passion. I'm
        new to the industry, but I am confident in my ability to work hard at
        anything I put my mind to.{" "}
      </p>

      <p>
        I'm a huge football fan and a supporter of Manchester United, go reds!{" "}
      </p>
    </div>
  );
};

export default Bio;
